/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-responsive-popover", tags, suffix)} id="${ifDefined(context._id)}-overflowMenu" horizontal-align="Right" placement-type="Bottom" content-only-on-desktop hide-arrow _hide-header class="ui5-tab-container-responsive-popover"><${scopeTag("ui5-list", tags, suffix)} mode="SingleSelect" separators="None" @ui5-item-click="${ifDefined(context._onOverflowListItemClick)}">${ context._endOverflowItems.length ? block1(context, tags, suffix) : block3(context, tags, suffix) }</${scopeTag("ui5-list", tags, suffix)}><div slot="footer" class="ui5-responsive-popover-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._closeRespPopover}">Cancel</${scopeTag("ui5-button", tags, suffix)}></div></${scopeTag("ui5-responsive-popover", tags, suffix)}>`;
const block1 = (context, tags, suffix) => html`${ repeat(context._endOverflowItems, (item, index) => item._id || index, (item, index) => block2(item, index, context, tags, suffix)) }`;
const block2 = (item, index, context, tags, suffix) => html`${ifDefined(item.overflowPresentation)}`;
const block3 = (context, tags, suffix) => html`${ repeat(context._startOverflowItems, (item, index) => item._id || index, (item, index) => block4(item, index, context, tags, suffix)) }`;
const block4 = (item, index, context, tags, suffix) => html`${ifDefined(item.overflowPresentation)}`;


export default block0;
